ulong CheckParity(ulong64 num)
{
	ulong out = ulong (num ^ (num>>32) & 0xffffffff);
	out ^= out >> 16;
	out ^= out >> 8;
	out ^= out >> 4;
	out ^= out >> 2;
	out ^= out >> 1;

	return (out & 0x1);
}


