void Hash_Blk(ulong64 Counter, ulong *Msg_Blk, ulong *ChainVar)
{
	const ulong PolyConst = 0x69b51909;
	short i, j;
	for (i=0; i<8; i++)
		*(Msg_Blk + i) ^= *(ChainVar + i);
	*(Msg_Blk + 6) ^= ulong (Counter >> 32);
	*(Msg_Blk + 7) ^= ulong (Counter & 0xffffffff);

	for (i=0; i<8; i++)
	{
		for (j=0; j<8; j++)
		{
			ulong64 poly = *(Msg_Blk + 2*j);
			poly = (poly << 32) ^ *(Msg_Blk + 2*j + 1);	
			
			ulong outpoly = ProcessPoly(poly);	
			*(ChainVar + j) = outpoly ^ PolyConst; 
		}
		
		for (j=0; j<8; j++)	
			*(Msg_Blk + j + 8) ^= *(ChainVar + j);

		if (i == 7)
			continue;

		ulong tmp1 = *Msg_Blk, tmp2 = *(Msg_Blk + 1);
		for (j=0; j<14; j++)
			*(Msg_Blk + j) = *(Msg_Blk + j + 2);
		*(Msg_Blk + 14) = tmp1;
		*(Msg_Blk + 15) = tmp2;
	}
	
	for (i=0; i<8; i++)
		*(ChainVar + i) = *(Msg_Blk + i + 8);
	
	return;
}
